import React from "react";
import Table from "react-bootstrap/Table";
import { useSelector } from "react-redux";

function ResultTable() {
  //Selectors
  const oneFetch = useSelector((state) => state.firstFetch.mainInformation);
  const departuresFetch = useSelector(
    (state) => state.fetchDepartures.allDepartures
  );

  console.log(departuresFetch);

  let tableTest = "";
  if (departuresFetch.departures) {
    let tableTest = (
      <div>
        <td>1</td>
        <td>Mark</td>
        <td>{departuresFetch.departures[0].arrival_timezone}</td>
      </div>
    );
  } else {
      let tableTest = ''
  }

  return (
    <div>
      {tableTest}
      <Table striped bordered hover>
        <thead>
          <tr>
            <th>#</th>
            <th>First Name</th>
            <th>Last Name</th>
            <th>Time</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>1</td>
            <td>Mark</td>
            <td>{tableTest}</td>
          </tr>
          <tr>
            <td>2</td>
            <td>Jacob</td>
            <td>Thornton</td>
            <td>@fat</td>
          </tr>
          <tr>
            <td>3</td>
            <td colSpan="2">Larry the Bird</td>
            <td>@twitter</td>
          </tr>
        </tbody>
      </Table>
    </div>
  );
}

export default ResultTable;
